('2337','18','7873','Villa Buntenbrroich',Null,'Hübsches Reihenhaus am Golfplatz von Camp de Mar ','32959','Das Reihenhaus, mit ca 137m² Wohnfläche, verteilt auf 2 Etagen, steht direkt am Golfplatz von Camp de Mar. Das gepflegte Haus bekam einen neuen Innen- und Außenanstrich und wird mit hochwertigen Möbeln (z.B. Lambert) verkauft. Zur Ausstattung gehören u.a. eine Alarmanlage, Doppelglasfenster mit Fliegengitter, Persianer, Einbauküche, Waschmaschine & Trockner. Die Wohnanlage bietet auch einen Gemeinschaftspool. Zum Golfplatz oder der driving range sind es nur wenige Gehminuten','32960','445000','106','2015-06-09 13:48:21','106','2015-06-09 13:49:40',Null,'2401','79','1129',1,'1','0',Null,Null,Null,'32961',Null,'0','0','0',Null,'2015-06-09 14:00:58',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'32962',Null,'32963',Null,'32964',Null,'32965','silvia 657762105','32966','0',0,'4');
